Wallapop, S.L, (di seguito, Wallapop),  in qualità di responsabile del trattamento, tratterà i dati forniti al fine di comunicarlo a un utente professionale esterno alla piattaforma Wallapop (un'immobiliare), che successivamente, la contatterà  per informarla sui propri prodotti/servizi che le interessano..
{$LINE_BREAK}{$LINE_BREAK} 
La base giuridica per il trattamento dei predetti dati è il consenso che Lei ha prestato legato al fatto di averli liberamente forniti attraverso tale processo. I dati personali saranno conservati fino a quando non ne richiederà la cancellazione. Una volta richiesta la cancellazione, i dati saranno mantenuti bloccati impedendone il trattamento, salvo che la messa a disposizione dei dati stessi a giudici e tribunali, alla Procura della Repubblica o alle Pubbliche Amministrazioni competenti, per l'esigenza di eventuali responsabilità derivanti dal trattamento e solo per il periodo di prescrizione della stessa (5 anni). Trascorso il periodo di tempo indicato, i dati verranno cancellati.
{$LINE_BREAK}{$LINE_BREAK} 
Puoi esercitare i tuoi diritti di accesso, rettifica, cancellazione, opposizione, limitazione del trattamento e portabilità dei tuoi dati, nonché revoca, in qualsiasi momento, del consenso prestato, davanti a Wallapop,  CIF nº B-66.04.9057, in Calle Meridiana 89 Planta 6º, 08026, Barcellona (Spagna), allegando una fotocopia della sua carta d'identità o un documento d'identità valido equivalente. Può anche esercitare i suoi diritti scrivendo a: privacidad@wallapop.com. Infine, le ricordiamo che può presentare un reclamo all'Agenzia spagnola per la protezione dei dati se ritiene che Wallapop abbia violato i suoi diritti alla protezione dei dati.
